self.addEventListener('message', async (e) => {
  const { type, payload, id } = e.data;

  if (type === 'init') {
    try {
      importScripts('https://unpkg.com/wanakana@5.3.1/wanakana.min.js');
      importScripts('https://cdn.jsdelivr.net/npm/kuromoji@0.1.2/build/kuromoji.js');

      self.kuromoji.builder({ dicPath: "https://cdn.jsdelivr.net/npm/kuromoji@0.1.2/dict/" }).build((err, tokenizer) => {
        if (err) {
          self.postMessage({ type: 'error', error: err });
        } else {
          self.tokenizer = tokenizer;
          self.postMessage({ type: 'ready' });
        }
      });
    } catch (err) {
      self.postMessage({ type: 'error', error: err.message });
    }
  } else if (type === 'tokenize') {
    if (!self.tokenizer || !self.wanakana) {
      self.postMessage({ type: 'tokenized', id, result: null });
      return;
    }
    try {
        const tokens = self.tokenizer.tokenize(payload);
        const romajiTokens = tokens.map(t => {
            const reading = t.reading ? t.reading : t.surface_form;
            return self.wanakana.toRomaji(reading);
        });
        let result = romajiTokens.join(' ');
        result = result.replace(/\\s+([.,!?;:])/g, '$1'); 
        if (result.length > 0) {
            result = result.charAt(0).toUpperCase() + result.slice(1);
        }
        self.postMessage({ type: 'tokenized', id, result });
    } catch (err) {
        self.postMessage({ type: 'tokenized', id, result: null });
    }
  }
});
